    public static function _IntToSimbolString(int $num = 0): string
    {
        $simbol = [' ','§c❶','§e❷','§6❸','§a❹','§a❺',' '];
        if(isset($simbol[$num]) && $num <= 5)  
        {
            return $simbol[$num];
        }
        return $simbol[0];
    }

