    public static function _encodeTerminalString(string $message): string{
    $message = str_replace('§f',"\x1b[38;5;231m",$message);
    $message = str_replace("§e","\x1b[38;5;227m",$message);
    $message = str_replace('§d',"\x1b[38;5;207m",$message);
    $message = str_replace("§c","\x1b[38;5;203m",$message);
    $message = str_replace("§b","\x1b[38;5;87m",$message);
    $message = str_replace("§a","\x1b[38;5;83m",$message);
    $message = str_replace("§9","\x1b[38;5;63m",$message);
    $message = str_replace('§8',"\x1b[38;5;59m",$message);
    $message = str_replace("§7","\x1b[38;5;145m",$message);
    $message = str_replace("§6","\x1b[38;5;214m",$message);
    $message = str_replace("§5","\x1b[38;5;127m",$message);
    $message = str_replace("§4","\x1b[38;5;124m",$message);
    $message = str_replace("§3","\x1b[38;5;37m",$message);
    $message = str_replace("§2","\x1b[38;5;34m",$message);
    $message = str_replace("§1","\x1b[38;5;19m",$message);
    $message = str_replace("§0","\x1b[38;5;16m",$message);
    $message = str_replace("§r","\x1b[m",$message);
    $message = str_replace("§l","\x1b[1m",$message);
    $message = str_replace("§o","\x1b[3m",$message);
    $message = str_replace("§n","\x1b[4m",$message);
    $message = str_replace("§m","\x1b[9m",$message);
    $message = str_replace("§k","",$message);
    return $message;
    }


